# 주제는 car, school, company
# 항복의 개수는 5개 이상
# json을 생성해서, 파이썬의 dict로 저장한 다음
# 5문제 이상 함께 만들어서 풀고 답글로 올려주세요!
# set(), list(), dict()모두 사용해보세요!

# car_make:BMW인 id list
# car_make 의 종류, 종류별 개수
# 2001년에 만들어진 model의 list
#차종류와 갯수 구하기
#차색깔이 빨간색인것중에 제조회사가 Nissan인 목록
#연도가 2000년 이상인것 목록 구하기

BMW_list = list()
for keys in car:
    if keys.get("car_make") == "BMW":
        BMW_list.append(keys.get("id"))
print("1. car_make:BMW인 id list:", BMW_list)

set_make = set()
dic_make = dict()

# car_make:BMW인 id list
for keys in car:
    set_make.add(keys.get("car_make"))

# car_make 의 종류, 종류별 개수
for makers in set_make: # set_make = 제조사 set, makers = 각 제조사
    maker_count = 0
    for keys in car:
        if keys.get("car_make") == makers:
            maker_count += 1
        dic_make[makers] = maker_count
print("2. car_make 의 종류:", set_make)
print("종류별 개수", dic_make)

# 2001년에 만들어진 model의 list
list_2001 = list()
for keys in car:
    if keys.get("model_year") == 2001:
        list_2001.append(keys.get("id"))
print("3. 2001년에 만들어진 model의 list:", list_2001)

# 차종류와 갯수 구하기
# 차색깔이 빨간색인것중에 제조회사가 Nissan인 목록
list_nissan_red = list()
for keys in car:
    if (keys.get("color") == "Red") & (keys.get("car_make") == "Nissan"):
        list_nissan_red.append(keys.get("id"))
print("차색깔이 빨간색인것중에 제조회사가 Nissan인 목록", list_nissan_red)
# 연도가 2000년 이상인것 목록 구하기
list_laterthan_2000 = list()
for keys in car:
    if int(keys.get("model_year"))>= 2000:
        list_laterthan_2000.append(keys.get("id"))
print("연도가 2000년 이상인것 목록:", list_laterthan_2000)